However, when I use the component with the `centered` variant, it is not centered on the screen. Instead, it is aligned to the left. I have tried to add `mx-auto` to the className, but it does not seem to have any effect.

Can someone please help me understand what I am doing wrong and how I can fix it?

Thank you!

## Answer (1)

You need to add `flex` to the parent container to make it a flex container. Then you can use `justify-center` to center the child element.

```
import React from 'react';

type Props = {
  variant: 'full-width' | 'centered';
  children: React.ReactNode;
};

const Layout: React.FC<Props> = ({ variant, children }) => {
  return (
    <div
      className={`flex ${
        variant === 'full-width' ? 'w-full' : 'mx-auto justify-center'
      } max-w-7xl px-4 sm:px-6 lg:px-8`}
    >
      {children}
    </div>
  );
};

export default Layout;
```

